eval("module.exports = {\n  \"content\": [\n    \"article\",\n    [\n      \"p\",\n      \"The use of design patterns in enterprise-level businesses can significantly increase the certainty of the R&D team, save unnecessary design and maintain system consistency, allowing the “designer” to focus on creativity where it is most needed.\"\n    ],\n    [\n      \"p\",\n      \"Design patterns adhere to Ant Design design values and provide a general solution to recurring design issues in enterprise products. The designer can directly use the design pattern to complete the interface design, or the design pattern can be used as a starting point to derive a more business-specific solution to meet the individual design needs.\"\n    ],\n    [\n      \"p\",\n      \"At the same time, this is a dynamically updated design document, and your reading and feedback is the driving force behind our progress, \",\n      [\n        \"a\",\n        {\n          \"title\": null,\n          \"href\": \"https://github.com/ant-design/ant-design/issues\"\n        },\n        \"Github Feedback Address\"\n      ],\n      \".\"\n    ],\n    [\n      \"h2\",\n      \"Framework Information\"\n    ],\n    [\n      \"p\",\n      [\n        \"img\",\n        {\n          \"title\": null,\n          \"src\": \"https://gw.alipayobjects.com/zos/rmsportal/NyWYOFQxJYElAwtUfSdv.png\",\n          \"alt\": \"Structure diagram\"\n        }\n      ]\n    ],\n    [\n      \"p\",\n      \"The complete design pattern will include examples of templates, components (ETC), and general-purpose concepts:\"\n    ],\n    [\n      \"ul\",\n      [\n        \"li\",\n        [\n          \"p\",\n          [\n            \"strong\",\n            \"Function example:\"\n          ],\n          \" Consists of multiple templates to inspire users how to use and build a common feature.\"\n        ]\n      ],\n      [\n        \"li\",\n        [\n          \"p\",\n          [\n            \"strong\",\n            \"Template:\"\n          ],\n          \" A page-level example that inspires users how to build a typical page in a system, such as a detail page.\"\n        ]\n      ],\n      [\n        \"li\",\n        [\n          \"p\",\n          [\n            \"strong\",\n            \"Component\"\n          ],\n          \"    - Basic components: The most basic elements of the system, such as buttons and pagers.    - Business components/modules: Block-level examples, typically consisting of multiple components, such as the PageHeader generic header.\"\n        ]\n      ],\n      [\n        \"li\",\n        [\n          \"p\",\n          [\n            \"strong\",\n            \"General concepts:\"\n          ],\n          \" Some conventions that guarantee ETC systematization, such as typesetting, fonts, and copywriting.\"\n        ]\n      ]\n    ],\n    [\n      \"h2\",\n      \"Resources\"\n    ],\n    [\n      \"p\",\n      \"We work with engineers to transform design patterns into reusable code that maximizes your productivity and communication efficiency.\"\n    ],\n    [\n      \"ul\",\n      [\n        \"li\",\n        [\n          \"p\",\n          [\n            \"a\",\n            {\n              \"title\": null,\n              \"href\": \"https://pro.ant.design\"\n            },\n            \"Ant Design Pro\"\n          ],\n          \": Out-of-the-box solution with 20+ templates and 10+ business components\"\n        ]\n      ],\n      [\n        \"li\",\n        [\n          \"p\",\n          [\n            \"a\",\n            {\n              \"title\": null,\n              \"href\": \"/docs/react/introduce\"\n            },\n            \"Ant Design Components\"\n          ],\n          \": Ant Design's React UI library is a global component library with 50+ base components\"\n        ]\n      ],\n      [\n        \"li\",\n        [\n          \"p\",\n          [\n            \"a\",\n            {\n              \"title\": null,\n              \"href\": \"http://library.ant.design/\"\n            },\n            \"Ant Design Library\"\n          ],\n          \": Axure resource packs are included with the code to make your prototype look like a visual draft, including templates, components, and more.\"\n        ]\n      ]\n    ]\n  ],\n  \"meta\": {\n    \"category\": \"Design Patterns\",\n    \"order\": 0,\n    \"title\": \"Overview\",\n    \"filename\": \"docs/spec/overview.en-US.md\"\n  },\n  \"toc\": [\n    \"ul\",\n    [\n      \"li\",\n      [\n        \"a\",\n        {\n          \"className\": \"bisheng-toc-h2\",\n          \"href\": \"#Framework-Information\",\n          \"title\": \"Framework Information\"\n        },\n        \"Framework Information\"\n      ]\n    ],\n    [\n      \"li\",\n      [\n        \"a\",\n        {\n          \"className\": \"bisheng-toc-h2\",\n          \"href\": \"#Resources\",\n          \"title\": \"Resources\"\n        },\n        \"Resources\"\n      ]\n    ]\n  ]\n};\n\n//# sourceURL=webpack:///./docs/spec/overview.en-US.md?./node_modules/bisheng/lib/loaders/source-loader.js");

